import React from 'react';
import useDatafetch from '../useDatafetch';
function CountryContainers(){
    const {flagName} = useDatafetch();
    return (
        <div>
            <div>
                {flagName.map((flag,idx)=>{
                    return(
                        <div>{flag[idx].flag}</div>
                    )
                })}
            </div>
        </div>
    );

}

export default CountryContainers;
